import React, { Component } from 'react';

class Login extends Component {
  render() {
    return (
      <div>
        <form onSubmit={this.submit}>
              <label>Who hosted the 2018 Polish Campout</label>
              <input type="text" value={this.state.answer} onChange={this.inputAnswer.bind(this)}/>
              <input type="submit" value="Submit"/>
          </form>
      </div>
    );
  }
}

export default Login;
